import React, {Component} from  'react';
import FilterButton from "../filter-button/filter-button";
import './task-filter.css';

export default class TaskFilter extends Component {

    state ={
        filter:
            [
                {label: 'all', className: 'selected'},
                {label: 'all', className: ''},
                {label: 'all', className: ''},
            ]

    }


    changeFilter =(label)=>{
        console.log(label)

    }


    render() {
        return (
            <ul className='filters'>
                <li><FilterButton changeFilter={this.changeFilter} className='selected' label='All'/></li>
                <li><FilterButton changeFilter={this.changeFilter} label='Active'/></li>
                <li><FilterButton changeFilter={this.changeFilter} label='Competed'/></li>
            </ul>
        );
    }

}
